<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>SVG Display</title>
    <style>
        body {
            margin: 0;
            display: flex;
            justify-content: center;
            align-items: center;
            min-height: 100vh;
            background-color: #E7DDCA;
        }
        .svg-container {
            max-width: 100vw;
            height: 100vh;
        }
        .moving-line {
  animation: dash-move 1s linear infinite;
}

@keyframes dash-move {
  to {
    stroke-dashoffset: -20;
  }
}

animated-path {
            stroke: black;
            stroke-width: 1.5;
            fill: none;
            stroke-dasharray: 10 10;
            animation: dashFlow 2s linear infinite, verticalMove 3s ease-in-out infinite;
        }

        @keyframes dashFlow {
            from {
                stroke-dashoffset: 0;
            }
            to {
                stroke-dashoffset: 20;
            }
        }

        /* Subtle vertical movement */
        @keyframes verticalMove {
            0%, 100% {
                transform: translateY(0);
            }
            50% {
                transform: translateY(-10px);
            }
        }

        /* Arrow heads animation */
        .arrow-heads {
            fill: black;
            animation: pulse 2s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% {
                opacity: 1;
                transform: scale(1);
            }
            50% {
                opacity: 0.7;
                transform: scale(1.1);
            }
        }
    </style>
</head>
